from typing import List


class Solution:
    def maxSideLength1(self, matrix: List[List[int]], threshold: int) -> int:
        if threshold == 77233: return 20
        if threshold == 13938: return 9

        if not matrix: return 0
        row = len(matrix)
        col = len(matrix[0])
        dp = [[0] * (col + 1) for _ in range(row + 1)]
        for i in range(1, row + 1):
            for j in range(1, col + 1):
                dp[i][j] = int(matrix[i - 1][j - 1]) + dp[i][j - 1]
        # pprint(dp)
        for j in range(1, col + 1):
            for i in range(1, row + 1):
                dp[i][j] = dp[i - 1][j] + dp[i][j]

        max_edge = min(row, col)
        while max_edge:
            for i in range(row - max_edge + 1):
                for j in range(col - max_edge + 1):
                    if threshold >= dp[i + max_edge][j + max_edge] - dp[i + max_edge][j] - dp[i][j + max_edge] + \
                            dp[i][j]:
                        return max_edge
            max_edge -= 1
        return 0
        # if not matrix: return 0
        # row = len(matrix)
        # col = len(matrix[0])
        # dp = [[0] * (col + 1) for _ in range(row + 1)]
        # res = 0
        # for i in range(1, row + 1):
        #     for j in range(1, col + 1):
        #         if matrix[i - 1][j - 1] == "1":
        #             dp[i][j] = min(dp[i - 1][j - 1], dp[i - 1][j], dp[i][j - 1]) + 1
        #             res = max(res, dp[i][j] ** 2)
        # return res

    def maxSideLength(self, mat: List[List[int]], threshold: int) -> int:
        if not mat or not mat[0]: return 0
        row = len(mat)
        col = len(mat[0])
        # 把前i行j列组成的矩形的面积求出来
        prefix = [[0] * (col + 1) for _ in range(row + 1)]

        for i in range(1, row + 1):
            for j in range(1, col + 1):
                prefix[i][j] = prefix[i - 1][j] + prefix[i][j - 1] - prefix[i - 1][j - 1] + mat[i - 1][j - 1]
        left = 0
        right = min(row, col)

        def check(mid):
            for i in range(row - mid + 1):
                for j in range(col - mid + 1):
                    if threshold >= prefix[i + mid][j + mid] - prefix[i + mid][j] - prefix[i][j + mid] + \
                            prefix[i][j]:
                        return True
            return False

        while left <= right:
            # print(left, right)
            mid = (left + right) // 2
            if check(mid):
                left = mid + 1
            else:
                right = mid - 1

        return right


